import React from 'react'
import Video  from "./Video";


const Grid = (props) => {
    const {data} = props;
    
    return (
        <div>
            {
                data.map(video => (
                    <div className='row m-0 mt-1 mb-1 w-100'>
                    <Video key={video.id} video={video} velicina={6}/>
                </div>
            ))
            }
        </div>
    )
}

export default Grid
